function App() {
  const date = new Date();
  const hrs = date.getHours();
  let cssStyle = {};
  const greeting = function () {
    if (hrs < 12) {
      cssStyle.color = "green";
      return "Good Morning";
    } else if (hrs > 12 && hrs < 19) {
      return "Good Afternoon";
    } else {
      return "Good Night";
    }
  };

  return (
    <>
      <h1>
        Hellow, <span style={cssStyle}>{greeting()}</span>
      </h1>
    </>
  );
}

export default App;
